    false,nt"url": null,nt"notes": "Earth Eye collected LiDAR data for approximately
    4,589 square kilometers that partially cover the Connecticut counties of Hartford,
    Tolland, Windham, Middlesex and New London. The nominal pulse spacing for this project
    was no greater than 1 point every 0.7 meters. Dewberry used proprietary procedures
    to classify the LAS according to project specifications: 1-Unclassified, 2-Ground,
    7-Noise, 9-Water. Dewberry produced 3D breaklines and combined these with the final
    LiDAR data to produce seamless hydro flattened DEMs for the 4,840 tiles (1000 m
    x 1000 m) that cover the project area.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
